import React from 'react'; 


const Todos = ({todos}) => { 

    const todolist = todos.length ? (
        todos.map(todo => { 
            return(
                <div className="collection-item" key={todo.id}>
                        <span>{todo.content}</span>
                </div>
            )
        })
    ) : ( 
        <p className="center">You have no todos left!</p>
    ); 

    return (


       <div className="todos collection container">
           {Todos}
       </div>



    )
}
